import React from 'react'
import './BlogItem.css'

const BlogItem = ({ blog: { id, discription, title, createdAt, authorName, authorAvatar, category, cover } }) => {
  return (
    <div className='blogItem-wrap'>
      <h1>Blog Item</h1>
    </div>
  )
}

export default BlogItem;
